import { Given, When, Then } from "@cucumber/cucumber";
import * as sinon from "sinon";
import assert from "assert";
import { GetOrderQueueUseCase } from "../../src/domain/aggregates/orderQueue/usecases/getOrderQueue/GetOrderQueue";
import { GetOrderQueueOutputDTO } from "../../src/domain/aggregates/orderQueue/usecases/getOrderQueue/GetOrderQueueDTO";

let result: GetOrderQueueOutputDTO;

const mockOrderQueue = {
	id: "123456",
	order_id: 1,
	status_queue: "concluido",
	waiting_time: "500",
	orderDate: "11/07/2023",
};

const QueueGatewayMock = {
	getOrderQueue: sinon.stub().resolves([mockOrderQueue]),
	getOrderQueueStatus: sinon.stub(),
	updateOrderQueue: sinon.stub(),
	add: sinon.stub(),
	beginTransaction: sinon.stub(),
	commit: sinon.stub(),
	rollback: sinon.stub(),
};

const mockGetOrderQueue: GetOrderQueueOutputDTO = {
	hasError: false,
	result: [mockOrderQueue],
};

Given("inicio a listagem de queue sem passar ID", async function () {
	const getOrderUseCase = new GetOrderQueueUseCase();
	return getOrderUseCase;
});

When("eu busco pela informacao de pedidos sem passar o id", async function () {
	result = await GetOrderQueueUseCase.execute({}, QueueGatewayMock);
	return result;
});

Then("o resultado deve ser de sucesso", function () {
	// ComparaÃ§Ã£o usando assert.deepStrictEqual
	assert.deepStrictEqual(
		result.hasError,
		false,
		"O campo hasError deve ser false"
	);
	assert.deepStrictEqual(
		result.result,
		[mockOrderQueue],
		"O campo result deve corresponder ao mockOrderQueue"
	);
});

import IOrderQueueGateway from '../../core/ports/IOrderQueueGateway';
import {
  GetOrderQueueInputDTO,
  GetOrderQueueOutputDTO,
  orderqueueInfo,
} from './GetOrderQueueDTO';

export class GetOrderQueueUseCase {
  static async execute(
    params: GetOrderQueueInputDTO,
    gateway: IOrderQueueGateway,
  ): Promise<GetOrderQueueOutputDTO> {
    let output: GetOrderQueueOutputDTO;
    let result;

    try {
      if (params.id) {
        result = await gateway.getOrderQueue(Number(params.id));
      } else {
        result = await gateway.getOrderQueue();
      }

      if (result.length == 0) {
        output = { hasError: false, httpCode: 204 };

        if (params.id) {
          output = {
            hasError: true,
            message:
              'Order not found. Please, certity that it is a valid Order Number!',
            httpCode: 404,
          };
          console.log(
            'Order not found. Please, certity that it is a valid Order Number!',
          );
        }
      } else {
        output = this.transformToOutput(result);
      }
    } catch (error: any) {
      output = {
        hasError: true,
        message: 'Failed to get order queue information',
        httpCode: 500,
      };

      console.log('Error in query Database', error);
    }

    return output;
  }

  static transformToOutput(result: any): GetOrderQueueOutputDTO {
    let output: GetOrderQueueOutputDTO = {
      hasError: false,
      result: [],
    };

    result.forEach((element: any) => {
      let orderQueue: orderqueueInfo = {
        id: element.id,
        order_id: element.order_id,
        status_queue: element.status_queue,
        waiting_time: element.waiting_time,
        orderDate: element.orderDate,
      };
      output.result?.push(orderQueue);
    });

    return output;
  }
}
